import math
import sys
from collections import deque


def dist(p1, p2):
    return math.sqrt((p1[0] - p2[0]) ** 2 + (p1[1] - p2[1]) ** 2)


def check(d, d1, d2):
    if d1 < d2:
        d2, d1 = d1, d2
    if d1 < 2 * d2:
        return True
    return False


def merge(d1, d2):
    x1, y1, v1x, v1y, r1 = d1
    x2, y2, v2x, v2y, r2 = d2
    x = (r1 ** 2 * x1 + r2 ** 2 * x2) / (r1 ** 2 + r2 ** 2)
    y = (r1 ** 2 * y1 + r2 ** 2 * y2) / (r1 ** 2 + r2 ** 2)
    v = (r1 ** 2 * v1x + r2 ** 2 * v2x) / (r1 ** 2 + r2 ** 2), (r1 ** 2 * v1y +
        r2 ** 2 * v2y) / (r1 ** 2 + r2 ** 2)
    return (x, y, v[0], v[1], math.sqrt(r1 ** 2 + r2 ** 2))


def main():
    n = int(input())
    d = deque([(int(x), int(y), int(vx), int(vy), int(r)) for x, y, vx,
        vy, r in (input().split() for _ in range(n))])
    t = 0
    while len(d) > 1:
        d1 = d.popleft()
        d2 = d.popleft()
        d = d.append(merge(d1, d2))
        t = t + 1
        while check(d, dist(d1, d2), 0.001):
            d.popleft()
            d2 = d.popleft()
            d = d.append(merge(d1, d2))
            t = t + 1
    if len(d):
        print(1, t)
    else:
        print(n, t)


def __starting_point():
    main()


