from math import sqrt
from collections import defaultdict


def prime(n):
    if n < 2:
        return False
    for i in range(2, int(sqrt(n)) + 1):
        if n % i == 0:
            return False
    return True


def solve(a):
    d = defaultdict(list)
    for i in range(len(a[0])):
        for j in range(len(a)):
            d[a[j][i]].append(j)
    for i in d:
        if len(d[i]) == len(a):
            return 0
    for i in d:
        if prime(i):
            for j in d[i]:
                for k in range(len(a[j])):
                    a[j][k] = i
    return max(max(row) - min(row) for row in a)


