def modfact(n, mod):
    f = 1
    fact = [1]
    for i in range(1, n + 1):
        f *= i
        f %= mod
        fact.append(f)
    inv = pow(f, mod - 2, mod)
    invfact = [0] * (n + 1)
    invfact[n] = inv
