class Solution:

    def majorityElement(self, nums):
        """
         :type nums: List[int]
         :rtype: List[int]
         """
        count1, count2, candidate1, candidate2 = 0, 0, 0, 1
        for num in nums:
            if num == candidate1:
                count1 += 1
            elif num == candidate2:
                count2 += 1
            elif count1 == 0:
                candidate1, count1 = num, 1
            elif count2 == 0:
                candidate2, count2 = num, 1
            else:
                count1 -= 1
                count2 -= 1
        result = []
        for num in nums:
            if num == candidate1:
                result.append(num)
            elif num == candidate2:
                result.append(num)
        return result

