def make_bipartite_graph(n, m):
    G = [[] for _ in range(n + 2)]
    for i in range(m):
        a, b = map(int, readline().split())
        a -= 1
        b -= 1
        G[a].append(b)
        G[b].append(a)
    return G


def topological_sort(G):
    from collections import deque
    q = deque()
    for i in range(len(G)):
        if not G[i]:
            q.append(i)
    P = []
    while q:
        i = q.popleft()
        P.append(i)
        for j in G[i]:
            if j == 0:
                continue
            G[j].remove(i)
            if not G[j]:
                q.append(j)
    return P


def get_center(G, P):
    C = 0
    for i in P:
        if len(G[i]) == len(P):
            C = i
    return C


def get_periphery(G, C):
    P = []
    for i in G[C]:
        if i < C:
            P.append(i)
        else:
            P.append(len(G[i]) - 1 - (len(P) - 1))
    return P


def get_max(G, P):
    M = 0
    for i in P:
        if len(G[i]) > M:
            M = len(G[i])
    return M


def get_stable(G, P, M):
    S = []
    for i in P:
        if len(G[i]) == M:
            S.append(i)
    return S


def get_important(G, S):
    I = []
    for i in S:
        for j in G[i]:
            if j not in S:
                I.append((i, j))
    return I


