class BIT():
    def __init__(self, n):
        self.n = n
        self.bit = [0] * (n + 1)
    def add(self, i, x):
        while i <= self.n:
            self.bit[i] += x
            i += i & -i
    def get(self, i):
        s = 0
        while i > 0:
            s += self.bit[i]
            i -= i & -i
        return s
    def getSum(self, l, r):
        return self.get(r) - self.get(l - 1)
    def lowerBound(self, w):
        if w <= 0:
            return 0
        i = 0
        k = 1 << self.n.bit_length()
        while k > 0:
            if i + k <= self.n and self.bit[i + k] < w:
                w -= self.bit[i + k]
                i += k
            k >>= 1
        return i + 1

