from math import atan2, hypot, pi, cos, sin
from collections import defaultdict


def distance(p1, p2):
    return hypot(p1[0] - p2[0], p1[1] - p2[1])


def angle(p1, p2):
    return atan2(p1[1] - p2[1], p1[0] - p2[0])


def rotate(p1, p2):
    return cos(angle(p1, p2)), sin(angle(p1, p2))


def get_touch_point(touches):
    xs, ys = 0, 0
    for x, y in touches:
        xs += x
        ys += y
    return xs / len(touches), ys / len(touches)


def get_grip(points):
    xs, ys = 0, 0
    for x, y in points:
        xs += x
        ys += y
    return xs / len(points), ys / len(points)


def get_touch_vectors(touches, grip):
    return [(rotate(get_touch_point(t), grip)[0], rotate(get_touch_point(
        t), grip)[1]) for t in touches]


def get_grip_vectors(touch_vectors, grip):
    return [(distance(grip, tv) for tv in touch_vectors) for touch_vectors in
        zip(*touch_vectors)]


def get_grip_rotation(grip_vectors):
    xs, ys = 0, 0
    for x, y in grip_vectors:
        xs += x
        ys += y
    return atan2(ys, xs)


def get_grip_rotation_distance(grip_vectors):
    return abs(get_grip_rotation(grip_vectors) - get_grip_rotation(
        [(-x, -y) for x, y in grip_vectors]))


def get_distance(grip_vectors, touch_vectors):
    return sum([distance(tv[0], tv[1]) for tv in zip(*touch_vectors)])


def get_pan_distance(grip_vectors, touch_vectors):
    return abs(get_grip_rotation(grip_vectors) - get_grip_rotation_distance(
        grip_vectors))


def get_zoom_distance(grip_vectors, touch_vectors):
    return abs(get_grip_rotation_distance(grip_vectors) - get_grip_rotation_distance(
        [(-x, -y) for x, y in grip_vectors]))


def get_rotate_distance(grip_vectors, touch_vectors):
    return abs(get_grip_rotation(grip_vectors) - get_grip_rotation(touch_vectors))


def get_rotate_angle(grip_vectors, touch_vectors):
    return get_grip_rotation(grip_vectors) - get_grip_rotation(touch_vectors)


def get_rotate_direction(grip_vectors, touch_vectors):
    return 'out' if get_grip_rotation_distance(grip_vectors) > get_grip_rotation(
        touch_vectors) else 'in'


def classify_gesture(grip_vectors, touch_vectors):
    pan = get_pan_distance(grip_vectors, touch_vectors)
    zoom = get_zoom_distance(grip_vectors, touch_vectors)
    rotate = get_rotate_distance(grip_vectors, touch_vectors)
    rotate_angle = get_rotate_angle(grip_vectors, touch_vectors)
    rotate_direction = get_rotate_direction(grip_vectors, touch_vectors)
    if pan > zoom + 0.1:
        return 'pan'
    elif pan < zoom + 0.1:
        return 'zoom', rotate_angle, rotate_direction
    else:
        return 'rotate', rotate_angle, rotate_direction


