class BIT():
    def __init__(self, n):
        self.n = n
        self.bit = [0] * (n + 1)
        self.data = [0] * (n + 1)

    def add(self, i, x):
        while i <= self.n:
            self.bit[i] += x
            self.data[i] += x
            i += i & -i

    def get(self, i):
        s = 0
        while i > 0:
            s += self.bit[i]
            i -= i & -i
        return s, self.data[i]

    def search(self, s):
        i = 0
        while i <= self.n:
            si, di = self.get(i)
            if si > s:
                i += 1
                continue
            s -= si
            i += i & -i
        return i - 1, s


